import React from "react";
import { Row } from "react-bootstrap";
import {Cards} from "./Cards";

export function CardsContainer(){
    return (
        <Row className='my-5 py-5 justify-content-center'>
            <Cards/>
            <Cards/>
            <Cards/>
            <Cards/>
        </Row>
    )
    
}
